import React, { useEffect, useState } from "react";

const AdminPage = () => {
  const [users, setUsers] = useState([]);
  const [products, setProducts] = useState([]);
  const [loadingUsers, setLoadingUsers] = useState(true);
  const [loadingProducts, setLoadingProducts] = useState(true);

  // Fetch users
  useEffect(() => {
    fetch("http://localhost:5000/api/admin/users")
      .then((res) => res.json())
      .then((data) => setUsers(data))
      .catch(console.error)
      .finally(() => setLoadingUsers(false));
  }, []);

  // Fetch products
  useEffect(() => {
    fetch("http://localhost:5000/api/admin/products")
      .then((res) => res.json())
      .then((data) => setProducts(data))
      .catch(console.error)
      .finally(() => setLoadingProducts(false));
  }, []);

  // Xóa user
  const deleteUser = (id) => {
    fetch(`http://localhost:5000/api/admin/users/${id}`, { method: "DELETE" })
      .then((res) => res.json())
      .then(() => setUsers(users.filter((u) => u._id !== id)))
      .catch(console.error);
  };

  // Xóa sản phẩm
  const deleteProduct = (id) => {
    fetch(`http://localhost:5000/api/admin/products/${id}`, { method: "DELETE" })
      .then((res) => res.json())
      .then(() => setProducts(products.filter((p) => p._id !== id)))
      .catch(console.error);
  };

  return (
    <div className="admin-page">
      <h1>Trang Quản Trị</h1>

      <section className="admin-section">
        <h2>Người dùng</h2>
        {loadingUsers ? <p>Đang tải...</p> : users.length === 0 ? <p>Chưa có user</p> : (
          <table>
            <thead>
              <tr>
                <th>Tên</th>
                <th>Email</th>
                <th>Thao tác</th>
              </tr>
            </thead>
            <tbody>
              {users.map(u => (
                <tr key={u._id}>
                  <td>{u.name}</td>
                  <td>{u.email}</td>
                  <td>
                    <button onClick={() => deleteUser(u._id)}>Xóa</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </section>

      <section className="admin-section">
  <h2>Sản phẩm</h2>
  {loadingProducts ? (
    <p>Đang tải...</p>
  ) : products.length === 0 ? (
    <p>Chưa có sản phẩm</p>
  ) : (
    <div className="product-grid">
      {products.map((p) => (
        <div key={p._id} className="product-card">
          <img src={p.images?.[0]?.url || "https://via.placeholder.com/150"} alt={p.name} />
          <h4>{p.name}</h4>
          <p>{p.basePrice?.toLocaleString()} ₫</p>
          <button onClick={() => deleteProduct(p._id)}>Xóa</button>
        </div>
      ))}
    </div>
  )}
</section>
    </div>
  );
};

export default AdminPage;
